const FollowButton = ({post}) => {
  const {me} = useSelector((state) => state.user);
  const onFollow = useCallback(() => {});
  return <Button onClick={onFollow}>팔로우</Button>;
};

FollowButton.porpTypes = {
  post: PropTypes.object.isRequired,
